$(function() {
	$("#nav a").addClass("ui-button ui-widget ui-state-default");
		$("#nav a span").addClass("ui-button-text");

		$("#nav a, #global-prev, #global-next").hover(function() {
			$(this).addClass("ui-state-hover");
		}, function() {
			$(this).removeClass("ui-state-hover");
		});
		
        jQuery('ul#descriptions h2').hover(function(){
                jQuery('ul.solarsystem li.' + jQuery(this).attr('id') ).toggleClass('active');
                jQuery(this).toggleClass('ui-button ui-widget ui-state-highlight ui-corner-all ui-button-text-only');
            });
            if(jQuery('div.wrap').height() > jQuery('body').height()){
                jQuery( 'div.wrap' ).position({
    				of: jQuery( 'body' ),
        			my: 'top',
        			at: 'top',
        			collision: 'none'
        		});
            }else{
                jQuery( 'div.wrap' ).position({
    				of: jQuery( 'body' ),
        			my: 'center',
        			at: 'center',
        			collision: 'none'
        		});
            }
            
		//jQuery("imageTexture").attr("url", newCol);
            
      jQuery('section#enneagram.clearfix div img.wrap').hover(function(){
			  jQuery(this).attr('src', 'data:image/svg+xml;base64,');
			}, function(){
			  jQuery(this).attr('src', 'data:image/svg+xml;base64,');
			});	

		
});
